void PortF_Init(void){

	SYSCTL_RCGCGPIO_R |= 0x20; //Turn Clock ON for port F
    //Wait for clock to stabilize
	int delay=0;
	delay++;
	delay++;
	delay++;
	delay++;
  GPIO_PORTF_LOCK_R = 0x4C4F434B;   // unlock GPIO Port F
  GPIO_PORTF_CR_R = 0x1F;           // allow changes to PF
  GPIO_PORTF_DIR_R |= ~0x1FD ; 			// inputs so write 0's to DIR
  GPIO_PORTF_AFSEL_R &= ~(0x1F);  // Turn alternate function OFF for all input and output pins
	GPIO_PORTF_PUR_R = 0x1F ;  // Engage Pull up for negative logic input switches
  GPIO_PORTF_DEN_R = 0xFF ; // Digital enable all input and output pins

}
